8 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:46433 &lt;/li&gt;\n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 16 &lt;/li&gt;\n          &lt;li&gt; Memory: 15.50 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.11.2 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n%%time\nfrom dask.distributed import performance_report\n\nwith performance_report():\n    # check time to run through each step sequentially\n    avhrr_sub2 = avhrr_sub2.isel(longitude=slice(0, 6), latitude=slice(0, 6)).chunk(chunk_dict)\n    print('running initial smooth...')\n    avhrr_sub2['NDVI_smth1'] = savgol_ndvi_xr(avhrr_sub2['NDVI'],\n                           dims=['time'],\n                          kwargs={'xdate': avhrr_sub2['time'].dt.dayofyear.values}).compute()\n    print('despiking...')\n    avhrr_sub2['NDVI_smth1_ds'] = despike_ts_xr(avhrr_sub2['NDVI_smth1'].chunk(chunk_dict), \n                          dat_thresh=0.07, days_thresh=30, dims=['time']).compute()\n    print('running secondary smooth...')\n    avhrr_sub2['NDVI_smth2'] = apply_savgol_xr(avhrr_sub2['NDVI_smth1_ds'].chunk(chunk_dict),\n                            dims=['time']).compute()\n    print('fitting double-logistic regression...')\n    avhrr_sub2['NDVI_dl'] = apply_dl_xr(avhrr_sub2['NDVI_smth2'].chunk(chunk_dict),\n                        dims=['time']).compute()\n    print('converting to dataframe...')\n    df_tmp = avhrr_sub2.to_dataframe().reset_index(drop=False)\n        &lt;/pre&gt;\n        "},"id":"1932","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1918","type":"PanTool"},{"attributes":{"start":0},"id":"1716","type":"DataRange1d"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},
